import React from "react";
import "./Selection.css";
import Snow from "./Component/Snow.jsx";
import SelectionMenu from "./Component/SelectionMenu.jsx";
import Waves from "./Component/waves.jsx";

function Selection() {
    return (
		<div className="hero">
			<Snow/>
			<SelectionMenu/>
            <Waves/>
		</div>
    );
};

export default Selection;
